import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import HomePage from './component/HomePage';
import LoginPage from './component/LoginPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        {/* Common LoginPage with dynamic paths for different user types */}
        <Route path="/login/:userType" element={<LoginPage />} />

        {/* If you want to navigate directly using userType in the path */}
        <Route path="/superadmin" element={<LoginPage userType="superadmin" />} />
        <Route path="/admin" element={<LoginPage userType="admin" />} />
        <Route path="/department" element={<LoginPage userType="department" />} />
        <Route path="/ledger" element={<LoginPage userType="ledger" />} />
        {/* ... add other user types as needed */}
      </Routes>
    </Router>
  );
}

export default App;
